CREATE TABLE `app_parklot_collector` (
  `ID` VARCHAR(36) NOT NULL COMMENT '主键ID ',
  `AREA_CODE` INT(10) DEFAULT NULL COMMENT '城市代码',
  `USER_ACCOUNT` VARCHAR(36) NOT NULL COMMENT '登录账户',
  `PASSWD` VARCHAR(64) NOT NULL COMMENT '登录密码',
  `USER_NAME` VARCHAR(36) NOT NULL COMMENT '收费员姓名',
  `SEX` VARCHAR(55) DEFAULT NULL COMMENT '性别',
  `TEL_PHONE` VARCHAR(55) DEFAULT NULL COMMENT '联系电话',
  `PARK_NAME` VARCHAR(55) DEFAULT NULL COMMENT '停车场名称',
  `PARK_ADDRESS` VARCHAR(355) DEFAULT NULL COMMENT '停车场地址',
  `PARK_TOTAL_NUM` INT(4) DEFAULT NULL COMMENT '泊位总数',
  `PARK_LOT_PD` VARCHAR(225) DEFAULT NULL COMMENT '闸机供应商',
  `PARK_SI` VARCHAR(225) DEFAULT NULL COMMENT '停车场运营商',
  `STATUS` INT(4) DEFAULT '0' COMMENT '0正常 1锁定 2注销 ',
  `FLAG` VARCHAR(16) NOT NULL DEFAULT 'ADD' COMMENT '操作标示 ADD：增加 UPDATE:修改 DELETE:删除',
  `CREATED_BY` VARCHAR(36) NOT NULL COMMENT '创建人',
  `UPDATED_BY` VARCHAR(36) DEFAULT NULL COMMENT '修改人',
  `CREATE_TIME` DATETIME NOT NULL COMMENT '创建时间',
  `UPDATE_TIME` DATETIME DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`ID`)
) ENGINE=INNODB DEFAULT CHARSET=utf8 CHECKSUM=1 DELAY_KEY_WRITE=1 ROW_FORMAT=DYNAMIC COMMENT='停车场收费员信息表';

